import React, { Component } from 'react';
import swal from 'sweetalert';

class SignOut extends Component {
    componentDidMount = () => {
        this.props.loggedOut(false);
    }

    render() {
        return (
            <>
            {swal("You Have Been Signed Out successfuly!")}
            </>
        );
    }
}

export default SignOut;
